import React from "react";

import {
  Container,
  Button,
  ButtonGroup,
  Center,
  Square,
  Circle,
  Box,
  Flex, Spacer 
} from "@chakra-ui/react";

const Landing = () => {
  return (
    <div>
      <Flex>
      <box>
        {" "}
        <Button colorScheme="blue">Login/Signup</Button>
      </box>

      <center>
        <header> Fantastic Happiness!</header>
      </center>
      <Spacer/>
      <Spacer/>
      </Flex>
<Flex>
      <Box bg = "gray.400" > Dev Profile </Box>
      <Spacer/>
      <Box bg = "gray.400" > Dev Profile </Box>
      <Spacer/>
      <Box bg = "gray.400" > Dev Profile </Box>
      <Spacer/>
      <Box bg = "gray.400" > Dev Profile </Box>
  </Flex>
    </div>
  );
};

export default Landing;
